"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-empty\"></span></div>				</div>\n			</div>\n			<p class=\"reviewer\">\n				By <a href=\"https://profiles.wordpress.org/shahinsheikh/\"><img alt=\'\' src=\'https://secure.gravatar.com/avatar/d53939faa54b5bf9d5902f9a54007a46cc83ad8fb7f906b7235258fda012d7d0?s=16&#038;d=monsterid&#038;r=g\' srcset=\'https://secure.gravatar.com/avatar/d53939faa54b5bf9d5902f9a54007a46cc83ad8fb7f906b7235258fda012d7d0?s=32&#038;d=monsterid&#038;r=g 2x\' class=\'avatar avatar-16 photo\' height=\'16\' width=\'16\' loading=\'lazy\' decoding=\'async\'/></a><a href=\"https://profiles.wordpress.org/shahinsheikh/\" class=\"reviewer-name\">shahinsheikh</a> on <span class=\"review-date\">February 25, 2025</span>			</p>\n		</div>\n	</div>\n	<div class=\"review-body\"><!-- wp:paragraph -->\n<p>should have AED currency to use for UAE sites. </p>\n<!-- /wp:paragraph --></div>\n</div>\n<div class=\"review\">\n	<div class=\"review-head\">\n		<div class=\"reviewer-info\">\n			<div class=\"review-title-section\">\n				<h4 class=\"review-title\">The best scalable ecommerce platform.</h4>\n				<div class=\"star-rating\">\n				<div class=\"wporg-ratings\" aria-label=\"5 out of 5 stars\" data-title-template=\"%s out of 5 stars\" data-rating=\"5\" style=\"color:#ffb900;\"><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span></div>				</div>\n			</div>\n			<p class=\"reviewer\">\n				By <a href=\"https://profiles.wordpress.org/adminalje/\"><img alt=\'\' src=\'https://secure.gravatar.com/avatar/ba85f7e059cd9add48fe5c5ff6b811abedf0ad6d9f0fac722b654373e68fedc9?s=16&#038;d=monsterid&#038;r=g\' srcset=\'https://secure.gravatar.com/avatar/ba85f7e059cd9add48fe5c5ff6b811abedf0ad6d9f0fac722b654373e68fedc9?s=32&#038;d=monsterid&#038;r=g 2x\' class=\'avatar avatar-16 photo\' height=\'16\' width=\'16\' loading=\'lazy\' decoding=\'async\'/></a><a href=\"https://profiles.wordpress.org/adminalje/\" class=\"reviewer-name\">Alje Ybanez <small>(adminalje)</small></a> on <span class=\"review-date\">February 23, 2025</span>			</p>\n		</div>\n	</div>\n	<div class=\"review-body\"><!-- wp:paragraph -->\n<p>been using WooCommerce since 2019.</p>\n<!-- /wp:paragraph --></div>\n</div>\n<div class=\"review\">\n	<div class=\"review-head\">\n		<div class=\"reviewer-info\">\n			<div class=\"review-title-section\">\n				<h4 class=\"review-title\">Email not working Junk</h4>\n				<div class=\"star-rating\">\n				<div class=\"wporg-ratings\" aria-label=\"1 out of 5 stars\" data-title-template=\"%s out of 5 stars\" data-rating=\"1\" style=\"color:#ffb900;\"><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-empty\"></span><span class=\"star dashicons dashicons-star-empty\"></span><span class=\"star dashicons dashicons-star-empty\"></span><span class=\"star dashicons dashicons-star-empty\"></span></div>				</div>\n			</div>\n			<p class=\"reviewer\">\n				By <a href=\"https://profiles.wordpress.org/hayden1917/\"><img alt=\'\' src=\'https://secure.gravatar.com/avatar/8341546ce99ddc55c745128349db9c6e3be6f9b93459bf624e0d99adab271d86?s=16&#038;d=monsterid&#038;r=g\' srcset=\'https://secure.gravatar.com/avatar/8341546ce99ddc55c745128349db9c6e3be6f9b93459bf624e0d99adab271d86?s=32&#038;d=monsterid&#038;r=g 2x\' class=\'avatar avatar-16 photo\' height=\'16\' width=\'16\' loading=\'lazy\' decoding=\'async\'/></a><a href=\"https://profiles.wordpress.org/hayden1917/\" class=\"reviewer-name\">hayden1917</a> on <span class=\"review-date\">February 21, 2025</span>			</p>\n		</div>\n	</div>\n	<div class=\"review-body\"><!-- wp:paragraph -->\n<p>Email not working Junk</p>\n<!-- /wp:paragraph --></div>\n</div>\n<div class=\"review\">\n	<div class=\"review-head\">\n		<div class=\"reviewer-info\">\n			<div class=\"review-title-section\">\n				<h4 class=\"review-title\">10 years of happy usage!</h4>\n				<div class=\"star-rating\">\n				<div class=\"wporg-ratings\" aria-label=\"5 out of 5 stars\" data-title-template=\"%s out of 5 stars\" data-rating=\"5\" style=\"color:#ffb900;\"><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span></div>				</div>\n			</div>\n			<p class=\"reviewer\">\n				By <a href=\"https://profiles.wordpress.org/lindam415/\"><img alt=\'\' src=\'https://secure.gravatar.com/avatar/a088e5938e8f903dc12e93b6a8076c715505cf593c55730034c94d6ff76d6fcb?s=16&#038;d=monsterid&#038;r=g\' srcset=\'https://secure.gravatar.com/avatar/a088e5938e8f903dc12e93b6a8076c715505cf593c55730034c94d6ff76d6fcb?s=32&#038;d=monsterid&#038;r=g 2x\' class=\'avatar avatar-16 photo\' height=\'16\' width=\'16\' loading=\'lazy\' decoding=\'async\'/></a><a href=\"https://profiles.wordpress.org/lindam415/\" class=\"reviewer-name\">lindam415</a> on <span class=\"review-date\">February 12, 2025</span>			</p>\n		</div>\n	</div>\n	<div class=\"review-body\"><!-- wp:paragraph -->\n<p>My first WooCommerce store was started 10+ years ago, since then I\'ve started many store, and overall it works great, also it\'s totally free which is pretty amazing really.<br /><br />Thank you</p>\n<!-- /wp:paragraph --></div>\n</div>\n<div class=\"review\">\n	<div class=\"review-head\">\n		<div class=\"reviewer-info\">\n			<div class=\"review-title-section\">\n				<h4 class=\"review-title\">FIX THIS PLEASE</h4>\n				<div class=\"star-rating\">\n				<div class=\"wporg-ratings\" aria-label=\"1 out of 5 stars\" data-title-template=\"%s out of 5 stars\" data-rating=\"1\" style=\"color:#ffb900;\"><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-empty\"></span><span class=\"star dashicons dashicons-star-empty\"></span><span class=\"star dashicons dashicons-star-empty\"></span><span class=\"star dashicons dashicons-star-empty\"></span></div>				</div>\n			</div>\n			<p class=\"reviewer\">\n				By <a href=\"https://profiles.wordpress.org/transmission2day/\"><img alt=\'\' src=\'https://secure.gravatar.com/avatar/7549b4d50c98396bbbb4839036d9e8ed5ba783426f5b0fe799db3c1d02a1a9ca?s=16&#038;d=monsterid&#038;r=g\' srcset=\'https://secure.gravatar.com/avatar/7549b4d50c98396bbbb4839036d9e8ed5ba783426f5b0fe799db3c1d02a1a9ca?s=32&#038;d=monsterid&#038;r=g 2x\' class=\'avatar avatar-16 photo\' height=\'16\' width=\'16\' loading=\'lazy\' decoding=\'async\'/></a><a href=\"https://profiles.wordpress.org/transmission2day/\" class=\"reviewer-name\">TRM2DAY <small>(transmission2day)</small></a> on <span class=\"review-date\">February 10, 2025</span>			</p>\n		</div>\n	</div>\n	<div class=\"review-body\"><!-- wp:paragraph -->\n<p>the<strong>left-aligned settings issue</strong>in WooCommerce\'s admin panel has been a long-standing design quirk that frustrates many users. The overly left-aligned text and cramped layout in the settings area can make navigating options feel cluttered and less user-friendlyespecially when working on smaller screens or with a lot of menu items.<br /><br />concerns about WooCommerce\'s integration with WordPress and the checkout page experience, such as the cumbersome country dropdown, are valid and shared by many users.</p>\n<!-- /wp:paragraph --></div>\n</div>\n<div class=\"review\">\n	<div class=\"review-head\">\n		<div class=\"reviewer-info\">\n			<div class=\"review-title-section\">\n				<h4 class=\"review-title\">DOES WORK AFTER UPDATE</h4>\n				<div class=\"star-rating\">\n				<div class=\"wporg-ratings\" aria-label=\"1 out of 5 stars\" data-title-template=\"%s out of 5 stars\" data-rating=\"1\" style=\"color:#ffb900;\"><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-empty\"></span><span class=\"star dashicons dashicons-star-empty\"></span><span class=\"star dashicons dashicons-star-empty\"></span><span class=\"star dashicons dashicons-star-empty\"></span></div>				</div>\n			</div>\n			<p class=\"reviewer\">\n				By <a href=\"https://profiles.wordpress.org/magones/\"><img alt=\'\' src=\'https://secure.gravatar.com/avatar/2f491ac6e30fa7e68f8bf1af122f03f386c22ca4f2a3f6e399c8f837ed8939a8?s=16&#038;d=monsterid&#038;r=g\' srcset=\'https://secure.gravatar.com/avatar/2f491ac6e30fa7e68f8bf1af122f03f386c22ca4f2a3f6e399c8f837ed8939a8?s=32&#038;d=monsterid&#038;r=g 2x\' class=\'avatar avatar-16 photo\' height=\'16\' width=\'16\' loading=\'lazy\' decoding=\'async\'/></a><a href=\"https://profiles.wordpress.org/magones/\" class=\"reviewer-name\">magones</a> on <span class=\"review-date\">February 6, 2025</span>			</p>\n		</div>\n	</div>\n	<div class=\"review-body\"><!-- wp:paragraph -->\n<p>WooCommerce decided to release an update, and now nothing works. Emails aren\'t being sent, even though everything is set up as usual. I\'ve tried fixing it with AI assistance, but without success. Even WS Forms suddenly stopped working, even though everything was fine before. Hope you working on this</p>\n<!-- /wp:paragraph --></div>\n</div>\n<div class=\"review\">\n	<div class=\"review-head\">\n		<div class=\"reviewer-info\">\n			<div class=\"review-title-section\">\n				<h4 class=\"review-title\">Translations stopped being respected in Filter by Attribute block</h4>\n				<div class=\"star-rating\">\n				<div class=\"wporg-ratings\" aria-label=\"5 out of 5 stars\" data-title-template=\"%s out of 5 stars\" data-rating=\"5\" style=\"color:#ffb900;\"><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span></div>				</div>\n			</div>\n			<p class=\"reviewer\">\n				By <a href=\"https://profiles.wordpress.org/freelancelab/\"><img alt=\'\' src=\'https://secure.gravatar.com/avatar/e4b3e45cf0ca542fc50a8b79446204c03eada0be983180a666c12543d9716a6c?s=16&#038;d=monsterid&#038;r=g\' srcset=\'https://secure.gravatar.com/avatar/e4b3e45cf0ca542fc50a8b79446204c03eada0be983180a666c12543d9716a6c?s=32&#038;d=monsterid&#038;r=g 2x\' class=\'avatar avatar-16 photo\' height=\'16\' width=\'16\' loading=\'lazy\' decoding=\'async\'/></a><a href=\"https://profiles.wordpress.org/freelancelab/\" class=\"reviewer-name\">i have a question <small>(freelancelab)</small></a> on <span class=\"review-date\">January 15, 2025</span>			</p>\n		</div>\n	</div>\n	<div class=\"review-body\"><!-- wp:paragraph -->\n<p>This problem has already been solved before and it seems to have occurred again:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>https: //github.com/woocommerce/woocommerce-blocks/issues/9870</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>The Filter by Attribute block has a <code>Select %s</code> translatable string for the placeholder (For example \"Select Color\").</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>I used Loco to translate it to just <code>%s</code>, so the placeholder would read simply \"Color\".</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>That used to work until the recent WooCommerce update.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>After the update, the placeholder reads \"Select Color\" again.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>I\'ve verified the string is still translated on Loco, synced the translation, and saved it - it didn\'t help.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>If relevant, the block is placed on the front page.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Tested with Twenty Twenty Three and all other plugins deactivated.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>...</p>\n<!-- /wp:paragraph --></div>\n</div>\n<div class=\"review\">\n	<div class=\"review-head\">\n		<div class=\"reviewer-info\">\n			<div class=\"review-title-section\">\n				<h4 class=\"review-title\">Bad Support</h4>\n				<div class=\"star-rating\">\n				<div class=\"wporg-ratings\" aria-label=\"1 out of 5 stars\" data-title-template=\"%s out of 5 stars\" data-rating=\"1\" style=\"color:#ffb900;\"><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-empty\"></span><span class=\"star dashicons dashicons-star-empty\"></span><span class=\"star dashicons dashicons-star-empty\"></span><span class=\"star dashicons dashicons-star-empty\"></span></div>				</div>\n			</div>\n			<p class=\"reviewer\">\n				By <a href=\"https://profiles.wordpress.org/developeresfera/\"><img alt=\'\' src=\'https://secure.gravatar.com/avatar/e72f65168883c60bdcc427fa770b38ec56c86611919e74355d5e05b2bd801c8c?s=16&#038;d=monsterid&#038;r=g\' srcset=\'https://secure.gravatar.com/avatar/e72f65168883c60bdcc427fa770b38ec56c86611919e74355d5e05b2bd801c8c?s=32&#038;d=monsterid&#038;r=g 2x\' class=\'avatar avatar-16 photo\' height=\'16\' width=\'16\' loading=\'lazy\' decoding=\'async\'/></a><a href=\"https://profiles.wordpress.org/developeresfera/\" class=\"reviewer-name\">developeresfera</a> on <span class=\"review-date\">January 13, 2025</span>			</p>\n		</div>\n	</div>\n	<div class=\"review-body\"><!-- wp:paragraph -->\n<p>Hello, I need assistance with the WooCommerce block filter. I reached out to support over three days ago, but I haven\'t received any response yet.</p>\n<!-- /wp:paragraph --></div>\n</div>\n<div class=\"review\">\n	<div class=\"review-head\">\n		<div class=\"reviewer-info\">\n			<div class=\"review-title-section\">\n				<h4 class=\"review-title\">A Positive Experience with WooCommerce and Its Support</h4>\n				<div class=\"star-rating\">\n				<div class=\"wporg-ratings\" aria-label=\"5 out of 5 stars\" data-title-template=\"%s out of 5 stars\" data-rating=\"5\" style=\"color:#ffb900;\"><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span></div>				</div>\n			</div>\n			<p class=\"reviewer\">\n				By <a href=\"https://profiles.wordpress.org/dalvac/\"><img alt=\'\' src=\'https://secure.gravatar.com/avatar/ebee2609e89ad48d89128ebd5e0cc672be43431eeb72c99ed4b24b97f2473f43?s=16&#038;d=monsterid&#038;r=g\' srcset=\'https://secure.gravatar.com/avatar/ebee2609e89ad48d89128ebd5e0cc672be43431eeb72c99ed4b24b97f2473f43?s=32&#038;d=monsterid&#038;r=g 2x\' class=\'avatar avatar-16 photo\' height=\'16\' width=\'16\' loading=\'lazy\' decoding=\'async\'/></a><a href=\"https://profiles.wordpress.org/dalvac/\" class=\"reviewer-name\">dalvac</a> on <span class=\"review-date\">January 8, 2025</span>			</p>\n		</div>\n	</div>\n	<div class=\"review-body\"><!-- wp:paragraph -->\n<p>I would like to share my experience with the WooCommerce plugin. I use it constantly and have been working with this tool for quite some time. Until recently, I had never encountered any issues.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Unfortunately, a mistake on my part caused a complete crash. Fortunately, I had a backup that allowed me to restore my site in its entirety, except for the WooCommerce Payments configuration. I was desperate, but I decided to reach out to support by submitting a request.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>I want to commend your team for their responsiveness and efficiency. You addressed my request quickly, which allowed me to resolve the issue without any difficulty.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>A big thank you for your excellent support! WooCommerce remains, for me, an essential and outstanding tool.</p>\n<!-- /wp:paragraph --></div>\n</div>\n\";}s:17:\"short_description\";s:146:\"Everything you need to launch an online store in days and keep it growing for years. From your first sale to millions in revenue, Woo is with you.\";s:13:\"download_link\";s:60:\"https://downloads.wordpress.org/plugin/woocommerce.9.7.1.zip\";s:14:\"upgrade_notice\";a:0:{}s:11:\"screenshots\";a:6:{i:1;a:2:{s:3:\"src\";s:64:\"https://ps.w.org/woocommerce/assets/screenshot-1.png?rev=3234504\";s:7:\"caption\";s:0:\"\";}i:2;a:2:{s:3:\"src\";s:64:\"https://ps.w.org/woocommerce/assets/screenshot-2.png?rev=3234504\";s:7:\"caption\";s:0:\"\";}i:3;a:2:{s:3:\"src\";s:64:\"https://ps.w.org/woocommerce/assets/screenshot-3.png?rev=3234504\";s:7:\"caption\";s:0:\"\";}i:4;a:2:{s:3:\"src\";s:64:\"https://ps.w.org/woocommerce/assets/screenshot-4.png?rev=3235205\";s:7:\"caption\";s:0:\"\";}i:5;a:2:{s:3:\"src\";s:64:\"https://ps.w.org/woocommerce/assets/screenshot-5.png?rev=3234504\";s:7:\"caption\";s:0:\"\";}i:6;a:2:{s:3:\"src\";s:64:\"https://ps.w.org/woocommerce/assets/screenshot-6.png?rev=3234504\";s:7:\"caption\";s:0:\"\";}}s:4:\"tags\";a:5:{s:9:\"ecommerce\";s:9:\"ecommerce\";s:12:\"online-store\";s:12:\"online store\";s:11:\"sell-online\";s:11:\"sell online\";s:4:\"shop\";s:4:\"shop\";s:13:\"shopping-cart\";s:13:\"shopping cart\";}s:8:\"versions\";a:477:{s:5:\"3.0.0\";s:60:\"https://downloads.wordpress.org/plugin/woocommerce.3.0.0.zip\";s:5:\"3.0.1\";s:60:\"https://downloads.wordpress.org/plugin/woocommerce.3.0.1.zip\";s:5:\"3.0.2\";s:60:\"https://downloads.wordpress.org/plugin/woocommerce.3.0.2.zip\";s:5:\"3.0.3\";s:60:\"https://downloads.wordpress.org/plugin/woocommerce.3.0.3.zip\";s:5:\"3.0.4\";s:60:\"https://downloads.wordpress.org/plugin/woocommerce.3.0.4.zip\";s:5:\"3.0.5\";s:60:\"https://downloads.wordpress.org/plugin/woocommerce.3.0.5.zip\";s:5:\"3.