has-text-align-center\">New in store</h2>\n<!-- /wp:heading -->\n\n<!-- wp:woocommerce/product-new {\"columns\":4,\"rows\":1} /--></div>\n<!-- /wp:woocommerce/empty-cart-block --></div>\n<!-- /wp:woocommerce/cart -->','Cart','','inherit','closed','closed','','8-revision-v1','','','2025-02-14 03:03:34','2025-02-14 03:03:34','',8,'http://gazelux.local/?p=12',0,'revision','',0);
